import React from 'react';

function ExpenseList({ expenses, onDeleteExpense }) {
  return (
    <div>
      <h2>지출 목록</h2>
      <ul>
        {expenses.map((expense) => (
          <li key={expense.id}>
            {expense.name} - ${expense.cost}
            <button onClick={() => onDeleteExpense(expense.id)}>삭제</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ExpenseList;
